export default function Index(){
  return(
    <CenterLayout>
      <StyledLink href='/hover3d'>
        <a>hover3d</a>
      </StyledLink>
    </CenterLayout>
  )
}

const StyledLink = styled(Link)`
  width: 200px;
  height: 80px;
  background: royalblue;
  color: white;
  border-radius: 10px;
  cursor: pointer;
  outline: none;
`
